#include <iostream>
#include <windows.h>

using namespace std;

double* product(double arr[], int len) {
	double* result = new double[len];
	result[0] = arr[0];
	for (int i = 1; i < len; i++) {
		result[i] = arr[i] * result[i - 1];
	}
	return result;
}
int main()
{
	SetConsoleOutputCP(1251);
	SetConsoleCP(1251);
	int N{};
	double total_product{ 1 };
	string words_array[10]{ "перший", "другий", "третій", "четвертий", "п'ятий", "шостий", "сьомий", "восьмий", "дев'ятий", "десятий" };
	while (true) {
		cout << "Введіть бажану кількість елементів у масиві (від 2 до 10): ";
		cin >> N;
		if (cin.fail() || N < 2 || N > 10) {
			cin.clear();
			cin.ignore(32767, '\n');
			cout << "Число було введено неправильно. Спробуйте ще раз!" << endl;
			continue;
		}
		else {
			break;
		}
	}
	double* array = new double[N];
	for (int i = 0; i < N; i++) {
		while (true) {
			cout << "Введіть " << words_array[i] << " елемент масиву: ";
			cin >> array[i];
			if (cin.fail()) {
				cin.clear();
				cin.ignore(32767, '\n');
				cout << "Число було введено неправильно. Спробуйте ще раз!" << endl;
				continue;
			}
			else {
				break;
			}
		}
	}
	double* result = product(array, N);
	cout << "Новий масив: ";
	for (int i = 0; i < N; i++) {
		cout << result[i] << " ";
		total_product *= result[i];
	}
	cout << endl << "Добуток чисел в новому масиві: " << total_product;
	delete[] array;
	delete[] result;
}

#include <iostream>
#include <windows.h>

using namespace std;

int minimal(double arr[], int len) {
	int min_index = 0;
	for (int i = 1; i < len; i++) {
		if (arr[i] < arr[min_index]) {
			min_index = i;
		}
	}
	return min_index;
}
int main()
{
	SetConsoleOutputCP(1251);
	SetConsoleCP(1251);
	int N{};
	string words_array[10]{ "перший", "другий", "третій", "четвертий", "п'ятий", "шостий", "сьомий", "восьмий", "дев'ятий", "десятий" };
	while (true) {
		cout << "Введіть бажану кількість елементів у масиві (від 2 до 10): ";
		cin >> N;
		if (cin.fail() || N < 2 || N > 10) {
			cin.clear();
			cin.ignore(32767, '\n');
			cout << "Число було введено неправильно. Спробуйте ще раз!" << endl;
			continue;
		}
		else {
			break;
		}
	}
	double* array = new double[N];
	for (int i = 0; i < N; i++) {
		while (true) {
			cout << "Введіть " << words_array[i] << " елемент масиву: ";
			cin >> array[i];
			if (cin.fail()) {
				cin.clear();
				cin.ignore(32767, '\n');
				cout << "Число було введено неправильно. Спробуйте ще раз!" << endl;
				continue;
			}
			else {
				break;
			}
		}	
	}
	cout << "Індекс мінімального елемента в масиві: " << minimal(array, N);
	delete[] array;
}

#include <iostream>
#include <windows.h>

using namespace std;

float root_square (float number){
	return sqrt(number);
}
int main()
{
	SetConsoleOutputCP(1251);
	SetConsoleCP(1251);
	float num{};
	while (true) {
		cout << "Введіть будь-яке число: ";
		cin >> num;
		if (cin.fail()) {
			cin.clear();
			cin.ignore(32767, '\n');
			cout << "Число було введено неправильно. Спробуйте ввести інше!" << endl;
			continue;
		}
		else {
			break;
		}
	}
	if (num < 0) {
		cout << "Неможливо видобути корінь з від'ємного числа!";
		return 0;
	}
	else {
		cout << "Корінь числа: " << root_square(num);
	}
}
